define(["jquery"],function($){var fullbar=530;function setcompletestatus(incount,totalcount){var incountEl=document.getElementById("incount"),totalCountEl=document.getElementById("totalcount"),uploadBarEl=document.getElementById("uploadbar"),progressBarEl=document.getElementById("progressbar");if(incountEl!==null){incountEl.innerHTML=incount}if(totalCountEl!==null){totalCountEl.innerHTML=totalcount}if(uploadBarEl!==null){uploadBarEl.width=parseInt(incount/totalcount*fullbar,10)}if(progressBarEl!==null){progressBarEl.style.display=""}}window.setcompletestatus=setcompletestatus;$(document).ready(function(){$.get(CPANEL.PAGE.ajax_request_url).done(function(data){$("#import-output-formatted").html(data)}).fail(function(){$("#import-output-formatted").html(LOCALE.maketext("An error occurred while processing your request."))})})});